import React from "react";
import { Link } from "react-router-dom";
import "./button.css"

const Button = () => {
    <Link to='/dashboard'>
        <button className="btn">
            Dashboard 
            <FontAwesomeIcon icon="fa-solid fa-gear" />
        </button>
    </Link>

}

export default Button;
